import React from "react";
import { Container, Flex } from "../styles/general/General.styled";
import { SignUpImage } from "../styles/SignInOut.styled";
import Navbar from "./general/Navbar";

const SignInOut = () => {
  return (
    <Container
      p="10rem 4rem"
      mh="100vh"
      bgColor="rgba(224, 247, 250, 0.8)"
      h="60%">
      <Navbar />
      <Flex bgColor="#f3e5f5" mh="60vh" br="6rem">
        <SignUpImage />
      </Flex>
    </Container>
  );
};

export default SignInOut;
